import React from 'react';



class Background extends React.Component {
  render() {

    const backgroundImage = 'https://images.pexels.com/photos/67636/rose-blue-flower-rose-blooms-67636.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=750&w=1260';
    const backgroundStyle = `backgroundImage: "url(${backgroundImage})"`;

     return(
    <section id="background" style={{backgroundStyle}}>
 <h1>Hello</h1>
    </section>)
  }
}


export default Background;
